Movie

Irish brothers Connor &amp; Murphy McManus live and work in Boston. Feeling that God's will to rid Earth from all human Evil was given to them as a mission, they set out to do their divine deed. A public outcry is never heard, and even FBI agent Paul Smecker, who follows their trace of bloodshed, admits that the boys are doing exactly what he secretly always has wished to happen. Risking their lives for their beliefs of Veritas (truth) and Aequitas (justice), the Boondock Saints are hyped by the public, for they are doing good, which only few dare to admit.

